import React from "react";
import { TextField } from "@material-ui/core";
import CardUI from "../UI/CardUI";
import styles from './AddUser.module.css'



const AddUser = () => {
  
  return (
    <CardUI className={styles.input}>
      <form >
        <TextField
          type="text"
          id="outlined-basic"
          label="Username"
          variant="outlined"
          
        />
        <TextField
          type="number"
          id="outlined-basic"
          label="Age(Years)"
          variant="outlined"
        />
      </form>
    </CardUI>
  );
};

export default AddUser;
